import React from "react";
import TwitterIcon from "@material-ui/icons/Twitter";
import FacebookIcon from "@material-ui/icons/Facebook";
import InstagramIcon from "@material-ui/icons/Instagram";
import EmailIcon from "@material-ui/icons/Email";
import LinkedInIcon from "@material-ui/icons/LinkedIn";
import { Grid } from "@material-ui/core";

function Footer() {
  return (
    <div
      style={{
        marginTop: "12%",
        height: "400px",
        width: "100%",
        backgroundColor: "darkgreen",
        color: "white",
      }}
    >
      <h2 style={{ textAlign: "center" }}>ABOUS AS</h2>
      <br />
      <h2 style={{ textAlign: "center" }}>CONTACTS</h2>
      <br />
      <Grid container justify="center" style={{ margin: "0 auto" }}>
        <TwitterIcon style={{ fontSize: "50px" }}></TwitterIcon>
        <FacebookIcon style={{ fontSize: "50px" }}></FacebookIcon>
        <InstagramIcon style={{ fontSize: "50px" }}></InstagramIcon>
        <EmailIcon style={{ fontSize: "50px" }}></EmailIcon>
        <LinkedInIcon style={{ fontSize: "50px" }}></LinkedInIcon>
      </Grid>
      <section
        style={
          {
            //   flexDirection: "colum",
            //   backgroundColor: "grey",
            //   position: "relative",
            //   marginTop: "5%",
          }
        }
      >
        <div
          style={{
            textAlign: "center",
            fontSize: "20px",
            color: "whitesmoke",
            borderTop: "50%",
          }}
        >
          &copy; Code Republic 2021
        </div>
      </section>
    </div>
  );
}

export default Footer;
